import { useNavigate } from "react-router-dom";
import "../ThreeOptions.css";

function ThreeOptions() {
  const navigate = useNavigate();
  return (
    <div className="ThreeOptions">
      <div id="optionsT">
        <button id="back" onClick={() => navigate(-1)}>
          {`<`}
        </button>
        <text>3가지 선택지를 드려요!</text>
      </div>
    </div>
  );
}

export default ThreeOptions;
